import { Link, useParams } from 'react-router-dom'

function ListItem() {

const ListItems = ({book}) => {
    
        <Link to={`/book/${book.id}`} style={{ textDecoration: 'none', color: 'inherit'}} className={"book-list-item"}>
        {book.title}
        </Link>


        // <div className="the-list">
        // <Link to={`/book/${book.id}`} style={{ textDecoration: 'none', color: 'inherit'}}>
        // <div className='book-list-item'>{book.title}</div>
        // </Link>
        // </div>
}

return (
    <ul>
        {ListItems.map((data) => (
        <li>{data.name}</li>
        ))}
    </ul>
);
    
}

export default ListItem
